import ButtonComponent from "./ButtonComponent";
import React, { useState } from "react";
function DenemeComponent(props) {
  let title = props.title;
  useState();
  return (
    <div>
      <h2>{title}</h2>
      <p>{props.amount}</p>
      <p>{props.date.toISOString()}</p>
      <ButtonComponent
      title = {title}  
      />
    </div>
  );
}

export default DenemeComponent;
